import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
require('dotenv').config({path: './.env'});


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
